// pages/Review.js
import React, { useState } from 'react';

const Review = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    rating: 5,
    comment: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Aqui você enviaria os dados para seu backend
    alert('Obrigado pela sua avaliação!');
    setFormData({
      name: '',
      email: '',
      rating: 5,
      comment: ''
    });
  };

  return (
    <div className="review-page">
      <div className="container">
        <h1>Avalie nossa Experiência</h1>
        
        <div className="review-content">
          <div className="review-form">
            <form onSubmit={handleSubmit}>
              <div className="form-group">
                <label htmlFor="name">Nome:</label>
                <input
                  type="text"
                  id="name"
                  name="name"
                  value={formData.name}
                  onChange={handleChange}
                  required
                />
              </div>
              
              <div className="form-group">
                <label htmlFor="email">Email:</label>
                <input
                  type="email"
                  id="email"
                  name="email"
                  value={formData.email}
                  onChange={handleChange}
                  required
                />
              </div>
              
              <div className="form-group">
                <label htmlFor="rating">Avaliação:</label>
                <div className="rating-stars">
                  {[1, 2, 3, 4, 5].map(star => (
                    <label key={star} className="star-label">
                      <input
                        type="radio"
                        name="rating"
                        value={star}
                        checked={parseInt(formData.rating) === star}
                        onChange={handleChange}
                      />
                      <span className="star">★</span>
                    </label>
                  ))}
                </div>
              </div>
              
              <div className="form-group">
                <label htmlFor="comment">Comentário:</label>
                <textarea
                  id="comment"
                  name="comment"
                  value={formData.comment}
                  onChange={handleChange}
                  rows="5"
                  required
                ></textarea>
              </div>
              
              <button type="submit" className="btn-primary">
                Enviar Avaliação
              </button>
            </form>
          </div>
          
          <div className="reviews-list">
            <h2>Avaliações Recentes</h2>
            <div className="review-item">
              <div className="review-header">
                <h3>Maria Silva</h3>
                <div className="rating">★★★★★</div>
              </div>
              <p>"Adorei a picanha! Ambiente muito agradável e atendimento excelente."</p>
            </div>
            
            <div className="review-item">
              <div className="review-header">
                <h3>João Santos</h3>
                <div className="rating">★★★★☆</div>
              </div>
              <p>"Costela no bafo estava deliciosa! Voltarei com certeza."</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Review;
